import React from "react";

function Home() {
  return (
    <div style={styles.container}>
      <h2>Welcome to DocStamp!</h2>
      <p>Easily upload, manage, and stamp your documents with security.</p>
      <button style={styles.button}>Get Started</button>
    </div>
  );
}

const styles = {
  container: {
    textAlign: "center",
    marginTop: "2rem",
  },
  button: {
    padding: "0.5rem 1rem",
    backgroundColor: "#007BFF",
    color: "#FFF",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
};

export default Home;
